import { Box, Button, Grid, Input, Paper, TextField } from "@mui/material";
import React from "react";
import background from "./images/wall.jpg";

const login = () => {
  return (
    <div style={{ backgroundImage: `url(${background})` }}>
      <Grid container sx={{ color: "black" }} spacing={2} top={2}>
        <Grid item md={3} xs={12} height="100px">
          <div style={{ fontSize: "24px" }}>
            Welcome <br /> God to see you
          </div>
        </Grid>
        <Grid item md={3} xs={12}>
          <TextField
            size="small"
            sx={{ width: "80%" }}
            placeholder="Username"
          ></TextField>
        </Grid>
        <Grid item md={3} xs={12}>
          <TextField
            size="small"
            sx={{ width: "80%" }}
            placeholder="Password"
            type="password"
          ></TextField>
        </Grid>
        <Grid item md={3} xs={12}>
          <Button variant="contained" sx={{ width: "50%" }}>
            Login
          </Button>
        </Grid>
      </Grid>
    </div>
  );
};

export default login;
